import React from 'react'
import Projects from './Projects';
import { motion } from "framer-motion"

function Home(props) {
    return (
        <div>
            <h1 class="text-center"> Portfolio </h1>
            <p class="text-center">
                Hello !
            </p>
            <motion.div animate={{ opacity: [0, 1] }} transition={{duration: 1, ease: "easeInOut"}}>
            <Projects/>
            </motion.div>
        </div>
    )
}

export default Home;
